import register from '../register';
import {getParams} from '../utils';
import log from './index';
register('feed/report', {
    ios: {
        versionRange: ['8.3'],
        hasCB: false,
        filter() {
            return {
                module: 'feed',
                action: 'report'
            };
        }
    },
    android: {
        versionRange: ['8.3'],
        hasCB: false,
        filter() {
            return {
                module: 'Bdbox_android_utils',
                action: 'report'
            };
        }
    }
});
/**
 * ubcreport
 * @function ubc
 * @param {object} [data={}] - ubc 参数
 */
export default (data = {}) => {
    return log(
        getParams('feedReport', {
            data,
            abtest: data.abtest
        })
    );
};
